import './App.css';

import React from 'react'
import Img from './component/img.js'
import Form from './component/form'


class App extends React.Component {
    constructor() {
    super()
    this.state = {
        isLoading: true,
        status: "",
        nanValue: "",
        nanValueAgeMean: "",
        describe: "",
        shape: "",
        cols: "",
        coldList: "",
        dtypes: "",
        colsWoPassenger: "",
        encoded: "",
        trainingScore: "",
        testingScore: "",
        figuresUrl: []
    };
}


    componentDidMount() {
        fetch("/api")
        .then(response => response.json())
        .then(data => {
            status = data.status
            data = JSON.parse(data.data)
            let nanValue = data.nan_value
            let nanValueAgeMean = data.nan_alue_age_mean
            let describe = data.describe
            let shape = data.shape
            let cols = data.cols
            let coldList = data.cold_list
            let dtypes = data.dtypes
            let colsWoPassenger = data.cols_wo_passenger
            let encoded = data.encoded
            let trainingScore = data.training_score
            let testingScore = data.testing_score
            let figuresUrl = data.figures_url
            this.setState({
                status: status,
                nanValue: nanValue,
                nanValueAgeMean: nanValueAgeMean,
                describe: describe,
                shape: shape,
                cols: cols,
                coldList: coldList,
                dtypes: dtypes,
                colsWoPassenger: colsWoPassenger,
                encoded: encoded,
                trainingScore: trainingScore,
                testingScore: testingScore,
                figuresUrl: figuresUrl
            })
        })
    }


    render() {
        console.log(this.state.cols[0])
